import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import Exercise1 from './components/Exercise1';
import Exercise2 from './components/Exercise2';
import Exercise3 from './components/Exercise3';
import Exercise4 from './components/Exercise4';

function Navigation() {
  return (
    <nav className="nav">
      <div className="nav-container">
        <h1 style={{ color: '#333', fontSize: '24px', fontWeight: 'bold' }}>
          React Exercises Lab
        </h1>
        <ul className="nav-links">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/exercise1">Exercise 1</Link></li>
          <li><Link to="/exercise2">Exercise 2</Link></li>
          <li><Link to="/exercise3">Exercise 3</Link></li>
          <li><Link to="/exercise4">Exercise 4</Link></li>
        </ul>
      </div>
    </nav>
  );
}

function Home() {
  const navigate = useNavigate();

  const exercises = [
    {
      id: 1,
      title: "Exercise 1: React Website",
      description: "A React-based website using components, elements, and styles with modern UI design.",
      path: "/exercise1"
    },
    {
      id: 2,
      title: "Exercise 2: User Profile",
      description: "A user profile page using React props to display user information dynamically.",
      path: "/exercise2"
    },
    {
      id: 3,
      title: "Exercise 3: Calculator",
      description: "A calculator application that performs basic arithmetic operations using React state management.",
      path: "/exercise3"
    },
    {
      id: 4,
      title: "Exercise 4: E-commerce",
      description: "A simple e-commerce website with multiple pages using React Router for navigation.",
      path: "/exercise4"
    }
  ];

  return (
    <div className="container">
      <div className="card">
        <h1 style={{ textAlign: 'center', marginBottom: '24px', color: '#333' }}>
          Welcome to React Exercises Lab
        </h1>
        <p style={{ textAlign: 'center', fontSize: '18px', color: '#666', marginBottom: '32px' }}>
          Click on any exercise below to explore the different React concepts and features.
        </p>
        
        <div className="exercise-grid">
          {exercises.map((exercise) => (
            <div 
              key={exercise.id} 
              className="exercise-card"
              onClick={() => navigate(exercise.path)}
            >
              <h3>{exercise.title}</h3>
              <p>{exercise.description}</p>
              <button className="btn">View Exercise</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="App">
        <Navigation />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/exercise1" element={<Exercise1 />} />
          <Route path="/exercise2" element={<Exercise2 />} />
          <Route path="/exercise3" element={<Exercise3 />} />
          <Route path="/exercise4" element={<Exercise4 />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
